	// Add content methods
	
	var addText = function(string) {
		textElements.push(string);
	}
	
	var finalFile = function(parts) {
		var zip = new JSZip();
		for (var part in parts) {
			zip.add(part, parts[part]);
		}
		return zip.generate();
	}
	
	return {
		output: function(type, options) {
			
			var buffer = generate();
			
			if(type == undefined) {
				
				return buffer;
			}
			if(type == 'datauri') {
				var outputFile = finalFile(buffer);
				document.location.href = 'data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,' + Base64.encode(outputFile);
			}
		// @TODO: Add different output options
		},
		text: function(string) {
			addText(string);
		}
	};
	
